  return (
    <div style={{ display: "flex", flexDirection: 'column', height: '100vh', gap: '5px', justifyContent: 'center', alignItems: 'center' }}>
      <div style={{ display: 'flex', width: '100%', justifyContent: 'center' }}>
        <Mensagens />
        <UsersList />
      </div>
    </div>
  );
}

export default App;
